                    APP_Data:用来保存数据文件、比如XML文件等;<br>
                    APP_Start：包含MVC系统启动的相关类;<br>
                    M:Model;负责操作数据库和处理业务逻辑（相当于三层中的BLL和DAL）/存放整个项目的模型代码文件;<br>
                    V:View; 用户看到的交互界面（显示结果）;<br>
                    C:Controller;接受用户输入，调用模板和视图完成用户的需求/存放整个项目“控制器”代码文件;
                    视图访问和寻址规则：<br>
                    a、在控制器使用View()方法调用视图，返回和“动作方法同名”的视图<br>
                    b、选择规则：View()方法默认从“View文件夹”下选寻找和控制器同名的文件夹
                            MVC中的约定<br>
                    a、控制器：必须以Controller结尾<br>
                    b、视图：必须放在VIews文件夹下。并且要和控制器同名的子目录中创建
                    约定胜于配置<br>
                    a、提前规定好<br>
                    b、无需配置<br>
                    不遵守规则出错<br>
