              <template slot="title">
                <h3 class="mvc">1、EF是什么</h3>
              </template>
              <div class="mvc2">
                EF（Entity Framework）:微软官方提供的ORM工具，ORM让开发人员节省数据库访问的代码时间，将更多的时间放到业务逻辑层代码上。EF提供变更跟踪、唯一性约束、惰性加载、查询事物等。开发人员使用Linq语言，对数据库操作如同操作Object对象一样省事。
              </div>
            </el-collapse-item>

