                    </template> 
                        <div class="mvc2">
                            <div>1.下载:可以在官网<el-link type="primary" :underline="false" href="http://www.codeisbug.com/">下载</el-link>，或者右击解决资源管理器，选择管理解决方案的NuGet程序包，在浏览里面输入SQLSugar，点击安装即可</div>
                            <div>2.支持：Oracle、Mysql、SqlSever等数据库</div>
                            <div>3.功能： 批量操作、AOP、读写分离、自定义Sql函数的扩展、动态表别名列别名，属性表别名列别名，子查询，JOIN，UNIONALL</div>
                            <div>1.优点： 性能、语法简单、功能强大和持续更新维护</div>
                        </div>              
                </el-collapse-item>
                <el-collapse-item>
                    <template slot="title">
                        <h3>2、连接数据库(一)</h3>
                    </template>
                    <div>
                        <el-card>
                            <div>SqlSugar是通过SqlSugarClient来进行数据库的操作，而创建SqlSugarClient我们需要ConnectionConfig这个类对象</div>
                            <el-divider content-position="left">
                                ConnectionConfig有6个属性分别是：
                            </el-divider>
                            <div>1、ConnectionString（<span class="red">必填</span>）：连接字符串</div>
                            <div>2、DataType（<span class="red">必填</span>）: 数据库类型</div>
                            <div>3、IsAutoCloseConnection：(默认false)是否自动释放数据库，设为true我们不需要close或者Using的操作，比较推荐</div>
                            <div>
                            <div>4、InitKeyType：(默认SystemTable)初始化主键和自增列信息的方式(注意：如果是数据库权限受管理限制或者找不到主键一定要设成attribute)</div>
                                 <div>InitKeyType.SystemTable表示自动从数据库读取主键自增列的信息（适合SA等高权限的账户）</div>
                                 <div class="red1">如果是这种模式实体类就普通的实体类便可以，不需要加任何东西</div>
                                 <div>InitKeyType.Attribute 表示从实体类的属性中读取 主键和自增列的信息(适合有独立的运维组的用户没有系统表操作权限)</div>
                                <div class="red1"> 如果是这种模式实体类需要有所改变</div>
                                 <el-card>                           
                                     <div>
                                        1.[SugarColumn(IsPrimaryKey=true,IsIdentity=true)] //如果是主键并且是自增列就加上2个属性</div>
                                        <div>2.[SugarColumn(IsPrimaryKey=true)]//如果只是主键只能加一个　</div>
                                 </el-card>
                            </div>
                            <div>5、ConnectionString（必填）：连接字符串(用于一些全局设置)。MoreSettings .IsAutoRemoveDataCache 为true表示可以自动删除二级缓存;MoreSettings .IsWithNoLockQuery 为true表式查询的时候默认会加上.With(SqlWith.NoLock)，可以用With(SqlWith.Null)让全局的失效</div>
                            <div>6、ConfigureExternalServices:可以扩展你想要的序列化方式和缓存方式等服务</div>
                        </el-card>                        
                    </div>
                </el-collapse-item>
                <el-collapse-item>
