                             <span style="color:#6666FF">public static </span> <span  style="color:#339999">SqlSugarClient</span> GetSQLInstance(<span style="color:#6666FF">string </span> ConnectionStringsName) <br>
                                {<br>
                                &emsp;<span  style="color:#339999">SqlSugarClient</span> db = <span style="color:#6666FF">new </span> <span  style="color:#339999">SqlSugarClient</span>(<span style="color:#6666FF">new </span> <span  style="color:#339999">ConnectionConfig</span>()<br>
                                &emsp;{<br>
                                    &emsp;&emsp;ConnectionString = System.Configuration.<span  style="color:#339999">ConfigurationManager</span>.ConnectionStrings[ConnectionStringsName].ConnectionString,<br>
                                    &emsp;&emsp;DbType = SqlSugar.<span  style="color:#339999">DbType</span>.SqlServer,&emsp;<span style="color:#CCCCCC">//SqlSugar.DbType.Oracle 连接Oracle数据库&emsp;//SqlSugar.DbType.MySql 连接&emsp;//SqlSugar.DbType.MySql MySql数据库&emsp;</span><br>
                                    &emsp;&emsp;IsAutoCloseConnection = <span style="color:#6666FF">true </span>,<br>
                                    &emsp;&emsp;InitKeyType = <span  style="color:#339999">InitKeyType</span>.Attribute<br>
                                &emsp;});     <br>      
                                 &emsp;db.Aop.OnLogExecuting = (sql, pars) =><br>  
                                &emsp;{<br>  
                                &emsp;&emsp;
                                <span  style="color:#339999">Console</span>.WriteLine(sql + "<span style="color:#cc99ff">\r\n</span>" + db.Utilities.SerializeObject(pars.ToDictionary(it => it.ParameterName, it => it.Value)));<br>  
                                &emsp;&emsp;<span  style="color:#339999">Console</span>.WriteLine();<br>  
                                &emsp;};<br> 
                                <span style="color:#cc99ff">return </span>db;<br>
                                }
