                            <el-card>
                                <div>
                                    <el-divider content-position="left">
                                       去重
                                    </el-divider>
                                     var _list=db.Queryable&lt;Student&gt;().GroupBy(it => new { it.studentID, it.studentName }).Select(it => new { it.studentID, it.studentName }).ToList(); <el-divider content-position="left">
                                       多个GroupBy写法
                                    </el-divider>
                                    var gourp = db.Queryable&lt;Student&gt;().GroupBy(it => it.studentName).GroupBy(it => it.studentID).Having(it => SqlFunc.AggregateCount(it.studentID) > 10).Select(it => new { id = SqlFunc.AggregateCount(it.studentID) }).ToList();   
                                  <el-divider content-position="left">
                                       多个GroupBy写法分组查询
                                    </el-divider>
                                    var _group = db.Queryable&lt;Student&gt;().GroupBy(it => it.studentID).Having(it => SqlFunc.AggregateCount(it.studentID)&lt; 10).Select(it => new { id = SqlFunc.AggregateCount(it.studentID) }).ToList();
                                </div>
                            </el-card>                       
